<?php

namespace Aft\MemberForms\Http\Controllers\Captcha;

use App\Http\Controllers\Controller;
use Illuminate\Http\Request;
use Illuminate\Support\Arr;
use Illuminate\Support\Facades\Hash;

class MathCaptchaController extends Controller
{
    public function getInfo()
    {
        $data = (object) [];
        $data->enabled = config('mathcaptcha.enabled');

        return json_encode($data);
    }

    public function generate(Request $request)
    {
        /* check gd extension enabled */
        if (extension_loaded('gd') === false) {
            throw new \Exception('Please enable GD extension in PHP.');
        }
        /* get length chars */
        $length = 7;
        /* get colors */
        $colors = [[90, 90, 90]];
        /* get backgrounds */
        $backgrounds = array_merge($this->getBackgroundImages(), []);
        $num1 = random_int(1, 9);
        $num2 = random_int(1, 3);
        $captcha = $num1.' + '.$num2.' =';
        /* select random */
        // $captcha = substr(str_shuffle($captcha), 0, $length);
        /* put captcha to session hashed */
        // Session::put('captcha-hex', hash("md5",$captcha));   //md5
        //Session::put('captcha-hex', hash("sha256", strval($num1 + $num2)));   //sha256
        //$request->session()->put('math-captcha-hash', hash("sha256", strval($num1 + $num2)));
        /* select background */
        $image = ImageCreateFromPNG(Arr::random($backgrounds));
        $image = imagecrop($image, ['width' => 33.333 * $length, 'height' => 60, 'x' => 0, 'y' => 0]);
        imagecolorallocate($image, 0, 0, 0); // set background color
        putenv('GDFONTPATH='.realpath('.')); //fix bug
        $font = base_path('resources/fonts/DejaVuSansMono.ttf');
        for ($i = 1; $i < $length + 1; $i++) {
            $color = Arr::random($colors);
            $text_color = imagecolorallocate($image, $color[0], $color[1], $color[2]);
            $char = substr($captcha, $i - 1, 1);
            imagettftext($image, random_int(16, 22), random_int(0, 30), $i * 30, 40, $text_color, $font, $char);
        }
        ob_start();
        /* resize to custom size */
        $imgResized = imagescale($image, 250, 40);
        ImagePng($imgResized);
        /* export to png base 64 */
        $data = (object) [];
        $data->randomImageId = base64_encode(Hash::make(strval($num1 + $num2)));
        $data->img = 'data:image/png;base64,'.base64_encode(ob_get_clean());

        return json_encode($data);
    }

    /**
     * Check this captcha correct or not
     *
     * @param  string  $captcha
     * @return bool
     */
    public function isValid($captchaAnswer, $encryptedAnswer)
    {
        $encryptedAnswer = base64_decode((string) $encryptedAnswer);

        return Hash::check($captchaAnswer, $encryptedAnswer);
        // return hash("sha256", strval($captchaAnswer)) == session('math-captcha-hash');
    }

    private function getBackgroundImages(): array
    {
        return [
            'data:image/png;base64,',
            'data:image/png;base64,',
        ];
    }
}
